/**
 * Pre-rendered ChRIS/CheLL logo captured with ascii-image-converter.
 * The colored variant uses embedded ANSI 24-bit codes; the plain variant strips them.
 */

const LOGO_BASE64 = "";

const ANSI_PATTERN = /\x1b\[[0-9;]*m/g;
const ANSI_RESET = '\x1b[0m';
const ANSI_REVERSE = '\x1b[7m';

const colorLogoLines: string[] = Buffer.from(LOGO_BASE64, 'base64')
  .toString('utf8')
  .trimEnd()
  .split('\n');

const plainLogoLines: string[] = colorLogoLines.map((line) => line.replace(ANSI_PATTERN, ''));

function reverse_line(line: string): string {
  // Ensure reverse stays on even if the line contains reset codes.
  const reinforced: string = line.replace(/\x1b\[0m/g, `${ANSI_RESET}${ANSI_REVERSE}`);
  return `${ANSI_REVERSE}${reinforced}${ANSI_RESET}`;
}

export function logo_linesRender(colorize: boolean, reverse: boolean = false): string[] {
  const baseLines: string[] = colorize ? colorLogoLines : plainLogoLines;
  if (!reverse) return baseLines;
  return baseLines.map(reverse_line);
}
